s($,"art","afb",()=>{var q="Bruno Gottlieb",p="Simbox Studios",o="LabInter UFSM",n=t.s
return A.a([A.ej("Rogue Masters","Advance Garde",B.bF,A.a(["Rogue Masters \xe9 o jogo onde me encontro trabalhando atualmente, atrav\xe9s da Advance Garde. O jogo constitui-se de uma mescla dos estilos rogue-like e souls-like, onde seu objetivo \xe9 combater a entropia numa batalha de hordas que podem ser jogadas em modo cooperativo ou sozinho.","\nPara mim foi uma honra ter entrado para o time pois sempre admirei muito o estilo souls. Sendo este um jogo cooperativo e com lan\xe7amento na Steam, tive a oportunidade de me aprimorar em diversas funcionalidades, tais como networking, server e cloud saving; al\xe9m de outros recursos como mapeamento de teclas e sistema de UI de modo geral.","\nO acesso \xe0 p\xe1gina da loja Steam e ao trailer no Youtube podem ser encontrados atrav\xe9s dos \xedcones acima desse texto, assim como em alguns outros projetos deste portf\xf3lio."],n),A.a(["images/rogueMasters/RogueMasters_1.jpg","images/rogueMasters/RogueMasters_2.jpg","images/rogueMasters/RogueMasters_3.jpg","images/rogueMasters/RogueMasters_4.jpg","images/rogueMasters/RogueMasters_5.jpg","images/rogueMasters/RogueMasters_6.jpg","images/rogueMasters/RogueMasters_7.jpg"],n)),A.ej("Truck Simulator","Rota Simuladores",B.bF,A.a(["Projeto desenvolvido atrav\xe9s da Rota Simuladores. Seu intuito \xe9 atuar como ferramenta auxiliar para motoristas de \xf4nibus e caminh\xe3o atrav\xe9s da simula\xe7\xe3o de f\xedsica e dirigibilidade real\xedstica. Juntamente com a simula\xe7\xe3o de ve\xedculos, foi tamb\xe9m desenvolvido um sistema para cria\xe7\xe3o de aulas. Atuei neste projeto como desenvolvedor principal.","\nO simulador funciona no hardware da Rota Simuladores, nos dispositivos G29 e G920 da Logitech, assim como no PC e joysticks."],n),A.a(["images/truck/Truck_1.jpg","images/truck/Truck_2.jpg","images/truck/Truck_3.jpg","images/truck/Truck_4.jpg","images/truck/Truck_5.jpg"],n)),A.ej("Souls-Like Boss Combat",q,B.bF,A.a(["Esse projeto surgiu atrav\xe9s da minha paix\xe3o por Dark Souls. Sempre admirei o sistema de combate souls, ent\xe3o resolvi aproveitar a oportunidade para fazer um projeto onde o intuito fosse batalhar contra um chefe, usando as mec\xe2nicas tradicionais.","\nPor tr\xe1s das cortinas havia um motivo que me fazia querer investir ainda mais nesse projeto, que era a oportunidade de me aperfei\xe7oar em anima\xe7\xf5es de modo geral e na l\xf3gica de movimenta\xe7\xe3o e intera\xe7\xe3o de personagens. O que ainda \xe9, at\xe9 hoje, o projeto que mais me possibilitou crescer neste t\xf3pico.","\nAproveitando o meu estudo, resolvi disponibilizar um v\xeddeo demonstrativo do projeto no Youtube e posteriormente disponibilizei o c\xf3digo fonte no GitHub para quem pudesse se beneficiar dele.","\nPor fim, acabou sendo uma boa abordagem pois foi interessante ver a intera\xe7\xe3o do p\xfablico e me motivou a seguir com esse tipo de projeto, posteriormente entrando para o time do Rogue Masters; projeto onde encontro-me trabalhando atualmente e consta no topo deste portf\xf3lio.","\nAinda possuo planos de fazer um projeto de combate mais aprimorado utilizando a Unreal Engine 5 em algum futuro pr\xf3ximo."],n),A.a(["images/soulsLike/SoulsLike_1.jpg","images/soulsLike/SoulsLike_2.jpg","images/soulsLike/SoulsLike_3.jpg","images/soulsLike/SoulsLike_4.jpg"],n)),A.ej("Tropical Racing",p,B.bF,A.a(["Tropical Racing \xe9 um jogo de corrida arcade voltado para o uso em cockpits automobil\xedsticos com suporte \xe0 force feedback e motion feedback.","\nEsse foi o primeiro projeto em que tive contato com esse tipo de hardware. O pr\xf3prio contato com um jogo de corrida tamb\xe9m me auxiliou muito para o desenvolvimento do simulador automobil\xedstico posteriormente.","\nEste acabou sendo um dos projetos mais divertidos que participei, uma vez que seu desenvolvimento proporcionou uma \xf3tima intera\xe7\xe3o entre a equipe na \xe9poca, onde frequentemente disput\xe1vamos para ver quem era o jogador com melhor tempo."],n),A.a(["images/tropicalRacing/TropicalRacing_1.jpg","images/tropicalRacing/TropicalRacing_2.jpg"],n)),A.ej("Motorcycle Game",p,B.bF,A.a(["Com uma ideia bem similar \xe0 do Tropical Racing, esse jogo de motovelocidade estava sendo desenvolvido para o uso em hardware simulador de moto. Sendo o hardware desenvolvido na f\xe1brica da Rota Simuladores.","\nEntretanto, apesar da confec\xe7\xe3o do hardware, ao decorrer do processo o jogo acabou n\xe3o sendo conclu\xeddo. Como ele nunca chegou a levar um nome, deixarei aqui ao t\xedtulo de Motorcycle game."],n),A.a(["images/motorcycle/Motorcycle_1.jpg","images/motorcycle/Motorcycle_2.jpg","images/motorcycle/Motorcycle_3.jpg"],n)),A.ej("Sky Crossing",p,B.jk,A.a(["Este foi o primeiro projeto em que tive contato com o desenvolvimento de jogos para o uso em Realidade Virtual, na \xe9poca com um Oculus Rift e um Oculus Rift S.","\nO jogo consiste em uma pequena cena para ser utilizada em centros de entretenimentos locais e seu intuito \xe9 simular uma travessia em grande altitude para proporcionar sensa\xe7\xf5es de adrenalina aos jogadores."],n),A.a(["images/skyCrossing/SkyCrossing_1.jpg","images/skyCrossing/SkyCrossing_2.jpg"],n)),A.ej("The Grand Sheriff",p,B.jk,A.a(["Assim como o Tropical Racing, esse jogo foi desenvolvido para ser usado com \xf3culos de realidade virtual em centros de entretenimento. Sendo assim, o segundo jogo em que tive contato com o desenvolvimento VR.","\nSeu objetivo \xe9 simular um tiroteio num cen\xe1rio de faroeste. O jogo \xe9 dividido em duas vers\xf5es, uma diurna e uma noturna, sendo essa segunda composta por maior n\xedvel de a\xe7\xe3o e dificuldade.","\nCom um foco na competitividade, ao final de cada partida \xe9 exibida a pontua\xe7\xe3o do jogador e inserida numa tabela de l\xedderes, processo realizado atrav\xe9s do v\xednculo com os servidores da Simbox Studios."],n),A.a(["images/theGrandSheriff/TheGrandSheriff_1.jpg","images/theGrandSheriff/TheGrandSheriff_2.jpg"],n)),A.ej("Kam\xea Kanhru",o,B.bG,A.a(["Este \xe9 um projeto muito importante para mim, pois, foi o projeto em que me colocou no ramo de desenvolvimento de jogos. Ao final do segundo ano da faculdade de Ci\xeancia da Computa\xe7\xe3o, acabei chegando at\xe9 este projeto atrav\xe9s de uma indica\xe7\xe3o, o que mudaria o rumo da minha carreira da\xed em diante.","\nO projeto \xe9 sediado no Centro de Artes e Letras da Universidade Federal de Santa Maria (UFSM) e possui uma equipe multidisciplinar de variados cursos da pr\xf3pria universidade.","\nSeu intuito \xe9 manter viva a cultura Kaing\xe1ng atrav\xe9s de aprendizagem interativa, servindo assim, como ferramenta de ensino nas escolas ind\xedgenas. Aqui o jogador poder\xe1 ter contato com o idioma Kaing\xe1ng, atrav\xe9s da escrita e das falas, al\xe9m de aprender sobre a hist\xf3ria atrav\xe9s da intera\xe7\xe3o com elementos culturais importantes.","\nO jogo \xe9 composto de uma campanha principal em 3D e de mini jogos em 2D, acessados atrav\xe9s da campanha. Aqui nesse portf\xf3lio coloquei imagens apenas de alguns dos mini jogos, visto que o 3D ainda est\xe1 em desenvolvimento.","\nPara garantir a integridade do projeto, s\xe3o realizadas din\xe2micas entre escolas e comunidades Kaing\xe1ngs de Santa Maria RS e Tenente Portela RS. Dessa forma podemos interagir com os professores e com as crian\xe7as, o que me trouxe uma experi\xeancia totalmente diferente do que eu estava acostumado, uma vez que passei a ter uma vis\xe3o mais humanit\xe1ria e contato muito mais pr\xf3ximo do que o habitual apenas no curso de computa\xe7\xe3o.","\nO jogo ser\xe1 lan\xe7ado tanto para desktops quanto para dispositivos m\xf3veis, sendo a acessibilidade um de seus focos principais.","\nEncontro-me pr\xf3ximo ao time e ao projeto at\xe9 os dias atuais, entretanto, n\xe3o estou mais atuando como programador, visto que com o tempo precisei de mais tempo para focar em outros projetos."],n),A.a(["images/projetoIndigena/ProjetoIndigena_1.jpg","images/projetoIndigena/ProjetoIndigena_2.jpg","images/projetoIndigena/ProjetoIndigena_3.jpg","images/projetoIndigena/ProjetoIndigena_4.jpg","images/projetoIndigena/ProjetoIndigena_5.jpg","images/projetoIndigena/ProjetoIndigena_6.jpg","images/projetoIndigena/ProjetoIndigena_7.jpg","images/projetoIndigena/ProjetoIndigena_8.jpg","images/projetoIndigena/ProjetoIndigena_9.jpg","images/projetoIndigena/ProjetoIndigena_10.jpg"],n)),A.ej("Tigres e Cachorros",o,B.bG,A.a(["Estava eu numa tarde exibindo o Projeto Ind\xedgena Kam\xe9 Kanhru para o p\xfablico da cidade de Santa Maria, num evento da UFSM, quando um casal ind\xedgena vem at\xe9 minha banca e comenta sobre o Jogo dos Tigres e dos Cachorros.","\nEles comentaram sobre como o jogo \xe9 culturalmente jogado no ch\xe3o, fazendo as marca\xe7\xf5es das linhas no ch\xe3o com gravetos e usando gr\xe3os de feij\xe3o / arroz ou pedrinhas como pe\xe7as. Em seguida, conseguiram uma folha, para desenhar como era o tabuleiro, juntamente com algumas mi\xe7angas para usar como pe\xe7as e me ensinaram a jogar.","\nO jogo consiste numa partida entre dois jogadores, onde um comanda dois tigres e outro comanda os cachorros. Os tigres vencem o jogo ap\xf3s comer um certo n\xedvel de cachorros. Os cachorros vencem ap\xf3s encurralar os tigres, deixando-os sem casas livres para se movimentar. Em geral \xe9 um bom jogo de estrat\xe9gia e que demonstra conceitos de trabalho em equipe.","\nFalando um pouco de seu desenvolvimento, resolvi aproveitar a oportunidade e torn\xe1-lo multijogador local e online. Foi a primeira vez em que tive contato com alguma networking na Unity. Nesse caso, a Photon Framework. O que serviu de grande aprendizado para troca de mensagens via RPC, uma vez que mesmo atualmente usando o Mirror, a ideia \xe9 extremamente similar.","\nO fato do jogo ser multijogador online permite algo que antes ainda n\xe3o era poss\xedvel: a intera\xe7\xe3o entre jogadores de diferentes comunidades ao redor do pa\xeds. Acredito que atualmente ainda n\xe3o h\xe1 dispon\xedvel outra vers\xe3o desse jogo com esse mesmo prop\xf3sito."],n),A.a(["images/tigresCachorros/TigresCachorros_1.jpg","images/tigresCachorros/TigresCachorros_2.jpg","images/tigresCachorros/TigresCachorros_3.jpg","images/tigresCachorros/TigresCachorros_4.jpg","images/tigresCachorros/TigresCachorros_5.jpg","images/tigresCachorros/TigresCachorros_6.jpg"],n)),A.ej("Santa is Late for Christmas!","Triplano",B.bF,A.a(["Este foi um projeto de duas semanas, oriundo de um processo seletivo onde o objetivo era fazer um jogo estilo endless runner para mobile. Optei por utilizar a tem\xe1tica natalina e acabei gostando do resultado. A programa\xe7\xe3o desse projeto possui alguns diferenciais, a exemplo, foi a primeira vez que utilizei o New Input System."],n),A.a(["images/santa/santaMedley.jpg"],n)),A.ej("Pong ML",q,B.bG,A.a(["A hist\xf3ria desse projeto \xe9 a seguinte: Estava eu cursando a disciplina de Intelig\xeancia Artificial na faculdade e precisava escolher um t\xf3pico de Redes Neurais para fazer um trabalho pr\xe1tico / te\xf3rico. Com isso, eu j\xe1 ciente da exist\xeancia da ferramenta ML-Agents da Unity, resolvi escolher o t\xf3pico de Machine Learning.","\nTendo o t\xf3pico escolhido e j\xe1 estudado a parte te\xf3rica, resolvi aplicar os conhecimentos na pr\xe1tica. Assim, pensei comigo mesmo: preciso de um jogo que seja multijogador, r\xe1pido de implementar e que seja divertido de jogar. A\xed que surge o cl\xe1ssico Pong na hist\xf3ria.","\nMeu principal objetivo com isso era sanar algumas d\xfavidas, tais como: 1. Consigo implementar uma IA capaz de derrotar um humano? 2. Qual ser\xe1 o comportamento desta IA, ela ir\xe1 se parecer com um jogador humano? 3. Quanto tempo ser\xe1 necess\xe1rio para trein\xe1-la?","\nEm resumo, criei duas vers\xf5es da IA. A 1.0 tendo treinado por 7 minutos, resultando numa acur\xe1cia de 80% e varia\xe7\xe3o de 20%; e a 2.0 tendo treinado por 3 horas, resultando numa acur\xe1cia de 99.4% e varia\xe7\xe3o de 1%. O resultado pode ser conferido atrav\xe9s do meu link de download do jogo ou mesmo atrav\xe9s do pr\xf3prio navegador (N\xe3o h\xe1 comandos para mobile).","\nDevido a uma falha de framerate durante o treinamento, tive que alterar o jogo de \xfaltima hora e treinar novamente o agente, resultando assim numa 2.0 inferior, embora ainda boa. Estarei deixando no play a vers\xe3o inferior est\xe1vel e estarei deixando nos arquivos a vers\xe3o verdadeira.","\nAl\xe9m da sala de aula, cheguei a ministrar uma oficina de Machine Learning utilizando esse projeto no Centro de Artes e Letras da UFSM, explicando os conceitos b\xe1sicos de ML e permitindo a intera\xe7\xe3o das pessoas com o jogo. Os materiais podem ser encontrados atrav\xe9s dos \xedcones acima desse texto."],n),A.a(["images/pongML/PongML_1.png","images/pongML/PongML_2.png"],n)),A.ej("Lunar Lander",q,B.bG,A.a(["Lunar Lander foi o segundo jogo que desenvolvi na Unity. Considero ele parte fundamental do come\xe7o da minha jornada como desenvolvedor de jogos e sempre o levo com bastante carinho na mem\xf3ria.","\nAqui o jogador deve controlar uma nave espacial usando os comandos de toque na tela e rota\xe7\xe3o do dispositivo m\xf3vel atrav\xe9s do aceler\xf4metro. O jogo possui 10 fases com dificuldade progressiva e o objetivo de cada uma delas \xe9 pousar a nave em seguran\xe7a no destino indicado.","\nApesar dos gr\xe1ficos e UI serem totalmente primitivos, acredito que seja um jogo divertido de modo geral e mostra a minha evolu\xe7\xe3o como desenvolvedor."],n),A.a(["images/lunarLander/LunarLander_1.jpg","images/lunarLander/LunarLander_2.jpg","images/lunarLander/LunarLander_3.jpg"],n)),A.ej("Pinky Lander",q,B.bG,A.a(["Com o surgimento do sistema de ilumina\xe7\xe3o 2D da Unity, senti vontade de fazer um projeto para test\xe1-lo na pr\xe1tica. Assim surgiu Pinky Lander, meio como um sucessor do Lunar Lander.","\nA ideia aqui \xe9 bem similar, o jogador controla uma esp\xe9cie de nave atrav\xe9s do aceler\xf4metro do celular e toques na tela. Com adi\xe7\xe3o de algumas mec\xe2nicas, como a de toque com um dedo para acelera\xe7\xe3o lenta e dois dedos para acelera\xe7\xe3o r\xe1pida. Outra mec\xe2nica \xe9 que agora o dano de colis\xe3o passou a ser bem menos punitivo, apenas em casos de velocidade muito alta.","\nA minha ideia inicial era p\xf4r o jogo na Play Store, entretanto, devido \xe0 m\xe1 otimiza\xe7\xe3o da ilumina\xe7\xe3o 2D em dispositivos m\xf3veis na \xe9poca, o projeto acabou ficando engavetado. Agora durante o desenvolvimento deste site resolvi resgatar o projeto e ver como ele est\xe1. Notei que algumas luzes acabaram se comportando de maneira estranha na transi\xe7\xe3o do projeto para a Unity 2022.2.0f1, mas resolvi gerar uma release do aplicativo ainda assim para quem quiser testar."],n),A.a(["images/newLunarLander/newLunarLander_5.jpg","images/newLunarLander/newLunarLander_6.jpg","images/newLunarLander/newLunarLander_7.jpg","images/newLunarLander/newLunarLander_8.jpg","images/newLunarLander/newLunarLander_2.png","images/newLunarLander/newLunarLander_3.png","images/newLunarLander/newLunarLander_4.png"],n)),A.ej("Insomnia",q,B.bG,A.a(["O surgimento de Insomnia \xe9 uma hist\xf3ria peculiar, nascida de uma necessidade pessoal. Num dia de recesso do trabalho, me vi em uma situa\xe7\xe3o em que meus hor\xe1rios estavam completamente trocados, dormindo durante o dia e ficando acordado \xe0 noite. Percebi que precisava tomar alguma atitude a respeito. Precisava buscar algo para ocupar meu tempo durante o dia todo, de modo a permanecer acordado at\xe9 a noite seguinte, quando poderia dormir e regularizar meu hor\xe1rio. Foi ent\xe3o que me sentei em frente ao computador. Decidi que faria algo, qualquer coisa - um projeto, um jogo; afinal, era o que sabia fazer. E assim, ap\xf3s 12 horas consecutivas de desenvolvimento, surge-se o prot\xf3tipo de Insomnia. O nome, uma homenagem ao seu prop\xf3sito original, traduz justamente essa jornada de ajuste do ciclo de sono.","\nO resultado foi duplamente positivo: n\xe3o apenas consegui ajustar meu hor\xe1rio de sono, mas tamb\xe9m criei um jogo divertido para dispositivos m\xf3veis. Aproveitei a oportunidade para estudar os servi\xe7os da PlayGames, incorporando conquistas e tabelas de lideran\xe7a ao jogo.","\nInspirado no estilo arcade cl\xe1ssico, Insomnia coloca o jogador no controle de uma nave espacial. O objetivo \xe9 avan\xe7ar enquanto enfrenta uma variedade de inimigos. Cada inimigo possui uma cor espec\xedfica e um comportamento \xfanico, exigindo do jogador adaptabilidade e estrat\xe9gias para supera-los. \xc0 medida que o jogador avan\xe7a, novos inimigos surgem, aumentando gradualmente a dificuldade."],n),A.a(["images/Insomnia/insomnia_1.png"],n))],A.a4("u<ns>"))})
